import React from 'react';
import styled from 'styled-components';

const Social = () => {
    return (
        <Wrapper>
            <div><img src="/images/new-social-1.png"/></div>
            <div><img src="/images/new-social-2.png"/></div>
            <div><img src="/images/new-social-3.png"/></div>
            <div><img src="/images/new-social-4.png"/></div>
        </Wrapper>
    )
}

const Wrapper = styled.div`
    position: fixed;
    bottom: 0;
    left: 0;
    z-index: 999;
    margin: 1em;
    img {
        width: 50px;
        height: 50px;
    }
}
`

export default Social
